-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS template_id_seq;

-- Table Definition
CREATE TABLE "public"."template" (
    "id" int4 NOT NULL DEFAULT nextval('template_id_seq'::regclass),
    "title" varchar,
    "created_at" timestamp DEFAULT CURRENT_TIMESTAMP,
    "created_by" int4,
    "updated_by" int4,
    "category_id" int4,
    "updated_date" timestamp,
    "fields" json,
    "version_number" float8,
    "current_file_path" varchar,
    "description" varchar(255),
    "htmldata" bytea,
    CONSTRAINT "template_category_id_fkey" FOREIGN KEY ("category_id") REFERENCES "public"."category"("id"),
    CONSTRAINT "template_created_by_fkey" FOREIGN KEY ("created_by") REFERENCES "public"."user_table"("id"),
    CONSTRAINT "template_updated_by_fkey" FOREIGN KEY ("updated_by") REFERENCES "public"."user_table"("id"),
    PRIMARY KEY ("id")
);

